import React, {useState} from 'react';
import { fetchAllPublicRoutines } from '../api';

const Routines = () => {
    const [routineList, setRoutineList] = useState([]);

    const fetchData = async () => {
        try {
            const results = await fetchAllPublicRoutines;
            console.log(results);
        } catch (error) {
            console.error(error);
        }
    }

    fetchData();

    return (
        <>
            <h2>All routines:</h2>
            <div id='routines'></div>
        </>
    )
}

export default Routines;
